import React from 'react';
import './Events.css';

const Events = ({ events }) => {
  return (
    <div className="events-container">
      <h2>Upcoming Events</h2>
      {events.length === 0 ? (
        <p>Loading events...</p>
      ) : (
        events.map((event) => (
          <div key={event.id} className="event-card">
            <h3>{event.title}</h3>
            <p>{event.description}</p>
          </div>
        ))
      )}
    </div>
  );
};

export default Events;
